    public @FunctionalInterface interface F9<R, T1, T2, T3, T4, T5, T6, T7, T8, T9> { R map(T1 t1, T2 t2, T3 t3, T4 t4, T5 t5, T6 t6, T7 t7, T8 t8, T9 t9); }
    public static <R, T1, T2, T3, T4, T5, T6, T7, T8, T9> ResultSetMapper<R> object(F9<R, T1, T2, T3, T4, T5, T6, T7, T8, T9> f9, ResultType<T1> t1, ResultType<T2> t2, ResultType<T3> t3, ResultType<T4> t4, ResultType<T5> t5, ResultType<T6> t6, ResultType<T7> t7, ResultType<T8> t8, ResultType<T9> t9) { return resultSet -> f9.map( t1.getResult(resultSet, 1), t2.getResult(resultSet, 2), t3.getResult(resultSet, 3), t4.getResult(resultSet, 4), t5.getResult(resultSet, 5), t6.getResult(resultSet, 6), t7.getResult(resultSet, 7), t8.getResult(resultSet, 8), t9.getResult(resultSet, 9) );}
    public @FunctionalInterface interface F10<R, T1, T2, T3, T4, T5, T6, T7, T8, T9, T10> { R map(T1 t1, T2 t2, T3 t3, T4 t4, T5 t5, T6 t6, T7 t7, T8 t8, T9 t9, T10 t10); }
